import React from "react";
import { Link } from "react-router-dom";
import { Box, ListItemIcon, Typography } from "@mui/material";
import { ExpandMore } from "@mui/icons-material";
import CommonRow from "../../components/CommonRow";
import { Container, Row, Col } from "react-bootstrap";
import "../../CSS/drone.css";
import { makeStyles } from "@material-ui/core/styles";
import { BatteryChargingFull } from "@material-ui/icons";

const useStyles = makeStyles({
  statusText: {
    textAlign: "center",
    color: "#afafaf",
    fontSize: "1.2rem",
  },
  chargingText: {
    /* Add your styles for the charging text here */
  },
  colorWave: {
    background:
      "linear-gradient(90deg, #00e1b4, #0079a9, #ffdc00, #ff4e00, #e8008b)",
    backgroundSize: "200% auto",
    color: "transparent",
    WebkitBackgroundClip: "text",
    backgroundClip: "text",
    animation: "$colorWave 10s ease infinite",
  },
  "@keyframes colorWave": {
    "0%": {
      backgroundPosition: "0% 50%",
    },
    "100%": {
      backgroundPosition: "100% 50%",
    },
  },
});

function Drone() {
  const classes = useStyles();

  return (
    <Container fluid>
      <div>
        <CommonRow />
      </div>
      <Row>
        <Col xs={12} sm={12} md={12} lg={12} xl={12} xxl={12}>
          <div className="drone-header-title-box">
            <div className="drone-header-title">Drone</div>
          </div>
        </Col>
      </Row>
      <Row>
        {/* Content for the third row */}
        <Col xs={12} sm={12} md={12} lg={12} xl={12} xxl={12}>
          <div className="drone-svg-container">
            <img
              src={process.env.PUBLIC_URL + "/assets/drone_diagram_large.svg"}
              alt="Drone Image"
              className="drone-large-svg"
            />
          </div>
        </Col>
      </Row>
      <Row>
        {/* Content for the third row */}
        <Col xs={12} sm={12} md={12} lg={12} xl={12} xxl={12}>
          <Row className="center-row">
            <div className="box">
              <p className="flight-text">Last flight completed:</p>
              <p className="date-text">May 7, 2021 1:28pm</p>
            </div>

            <div className="box">
              <p className="status-text">Status:</p>
              <p className={`${classes.chargingText} ${classes.colorWave}`}>
                <BatteryChargingFull />
              </p>
            </div>

            <div className="box">
              <p className="battery-text">Battery Charge:</p>
              <p className="percent-text">38.41%</p>
            </div>
          </Row>
        </Col>
      </Row>
    </Container>
  );
}

export default Drone;
